      speed: 500,
      slidesToShow: 3,
      slidesToScroll: 1,
      responsive: [
        {
          breakpoint: 1199,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 1,
            infinite: true,
            dots: false
          }
        },
        {
          breakpoint: 991,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1,
            infinite: true,
            dots: false
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1,
            initialSlide: 1
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        },
        {
          breakpoint: 395,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        
        },
        {
          breakpoint: 320,
          settings: {
            slidesToShow: .95,
            slidesToScroll: 1
          }
        }
      ]
    };

    return (
   
     <div className="products">
         <div className="container">
<div className="row">
    <div className="col-sm-12">
         <h5>OUR PORTOFOLIO</h5>
         <h1>See Our Recent <span>Projects</span></h1>
         <img src={bar} style={{width:"7em",height:".3em"}}/>
         <Projectcontent/>

     </div>
     </div>
     </div>
     </div>

    );
  }
}
